function sidebar() {
  return (
    <div className="grid grid-cols-2 bg-black h-screen w-28">
    {/* <img src={}/> */}
      <div >
        <Home className="w-5 ml-9 mt-8 cursor-pointer text-white"/>
        <Movies className="w-5 ml-9 mt-8 cursor-pointer text-white"/>
        <Search className="w-5 ml-9 mt-8 cursor-pointer text-white"/>
        <Profile className="w-5 ml-9 mt-8 cursor-pointer text-white"/>
      </div>
    </div>
  );
}

export default sidebar;
